import React from "react";
import {
  Card,
  CardHeader,
  CardContent,
  CardActions,
  Typography,
  List,
  ListItem,
  ListItemText,
} from "@material-ui/core";
import { makeStyles } from "@material-ui/styles";
import { UnitTemplate } from "./UnitTemplate";

function SingleUnitList() {
  return (
    <div>
        <List>
            {UnitTemplate.map((val, key) => (
                <ListItem key={key} >
                    <ListItemText>{val.title} {"\n"} {val.grade} </ListItemText>
                </ListItem>
            ))}
        </List>
    </div>
  );
}

export default SingleUnitBlock;
